import React from "react";
import "./Coustomer.css";
import { Link as RouterLink } from "react-router-dom";
import Slider from "react-slick";
const Coustomer = () => {
  function SampleNextArrow(props) {
    const { className, style, onClick } = props;
    return (
      <div
        className={className}
        style={{ ...style, display: "block", background: "red" }}
        onClick={onClick}
      />
    );
  }

  function SamplePrevArrow(props) {
    const { className, style, onClick } = props;
    return (
      <div
        className={className}
        style={{ ...style, display: "block", background: "green" }}
        onClick={onClick}
      />
    );
  }

  var settings = {
    dots: true,
    infinite: false,
    speed: 500,
    slidesToShow: 2,
    slidesToScroll: 2,
    initialSlide: 0,
    nextArrow: <SampleNextArrow />,
    prevArrow: <SamplePrevArrow />,
    responsive: [
      {
        breakpoint: 1024,
        settings: {
          slidesToShow: 2,
          slidesToScroll: 2,
          infinite: true,
          dots: true,
        },
      },
      {
        breakpoint: 600,
        settings: {
          slidesToShow: 1,
          slidesToScroll: 1,
          initialSlide: 1,
        },
      },
      {
        breakpoint: 480,
        settings: {
          slidesToShow: 1,
          slidesToScroll: 1,
        },
      },
    ],
  };
  return (
    <>
      <div className="coustomer" id="customer-purchase">
        <div className="container">
          <h1 className="mb-4 ">Customer Purchase</h1>
          <div className="row">
            <div className="col-md-6 col-12">
              <div className="coustomer-card">
                <div className="row">
                  <div className="col-6">
                    <img src="" alt="img" />
                  </div>
                  <div className="col-6">
                    <img src="" alt="img" />
                  </div>
                  <div>
                    <p>Purchased by Dana in Los Angeles, CA</p>
                    <p>"swimming oasis" on a notebook</p>
                  </div>
                  <div className="button">
                    <RouterLink to="/start-generating-art">
                      Remix or Purchse
                    </RouterLink>
                  </div>
                </div>
              </div>
            </div>
            <div className="col-md-6 col-12">dd</div>
          </div>
          <Slider {...settings}>
            <div>
              <h3>1</h3>
            </div>
            <div>
              <h3>2</h3>
            </div>
            <div>
              <h3>3</h3>
            </div>
            <div>
              <h3>4</h3>
            </div>
            <div>
              <h3>5</h3>
            </div>
            <div>
              <h3>6</h3>
            </div>
          </Slider>
        </div>
      </div>
    </>
  );
};

export default Coustomer;
